import { useEffect } from "react";


const Split1 = () =>{
    return (
            <div className="split1">
                <span></span>
                <p>Cliquez pour découvrir</p>
                <span></span>
            </div>
    );
};


const Menu_page_dev_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Développement</p>
    </div>
    );

};


const Menu_page_son_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Son</p>
    </div>
    );

};


const Menu_page_visual_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Visuel</p>
    </div>
    );

};



const Menu_page = () =>{



    useEffect(() => {
        const dev_item = document.getElementById("dev_item"); 
        const son_item = document.getElementById("son_item"); 
        const visual_item = document.getElementById("visual_item"); 



        const handleScroll = () => {

            const dev_item_translate =  - 500 + window.scrollY * 0.1; 
            const son_item_translate =  - window.scrollY * 0.1; 
            const visual_item_translate =  - 50 + window.scrollY * 0.1; 


            dev_item.style.transform = `translateX(${dev_item_translate}px)`;
            son_item.style.transform = `translateX(${son_item_translate}px)`;
            visual_item.style.transform = `translateX(${visual_item_translate}px)`;
        };



        const hoverOpacity = () =>{
            dev_item.addEventListener("mouseover", () => {
                son_item.style.opacity = "0.7"; 
                visual_item.style.opacity = "0.7"; 
            });
            son_item.addEventListener("mouseover", () => {
                dev_item.style.opacity = "0.7"; 
                visual_item.style.opacity = "0.7"; 
            });
            visual_item.addEventListener("mouseover", () => {
                son_item.style.opacity = "0.7"; 
                dev_item.style.opacity = "0.7"; 
            });

            dev_item.addEventListener("mouseout", () => {
                son_item.style.opacity = "1"; 
                visual_item.style.opacity = "1"; 
            });
            son_item.addEventListener("mouseout", () => {
                dev_item.style.opacity = "1"; 
                visual_item.style.opacity = "0.7"; 
            });
            visual_item.addEventListener("mouseout", () => {
                son_item.style.opacity = "0.7"; 
                dev_item.style.opacity = "0.7"; 
            });


        }; 





        window.addEventListener('scroll', handleScroll);
        hoverOpacity(); 

        return () => {
            window.removeEventListener('scroll', handleScroll);
        };
    }, []);


    return (
        <div className="menu_page">
            <Split1/>
            <div className="carrousel" id="dev_item">
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
            </div>
            <span className="split2"></span>
            <div className="carrousel" id="son_item">
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
                <Menu_page_son_item/>
            </div>
            <span className="split2"></span>
            <div className="carrousel" id="visual_item">
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
                <Menu_page_visual_item/>
            </div>
            <Split1/>

        </div>
    );
};

export default Menu_page;
